import { useEffect, useState } from "react";

const Home = () => {
  useEffect(() => {
    const fetchUsers = async () => {
      const response = await fetch("https://localhost:5050");
    };

    fetchUsers();
  }, []);

  return (
    <div className="home">
      <h2>Home</h2>
    </div>
  );
};

export default Home;
